import React from 'react';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Button from 'react-bootstrap/Button';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';
import NavDropdown from 'react-bootstrap/NavDropdown';

class Navigation extends React.Component{
	render(){
		return(
			<Navbar bg="light" expand="lg">
				<Button variant="outline-success">Generate New Array</Button>
			  <Button variant="outline-success">Marge Sort</Button>
			  <Button variant="outline-success">Quick Sort</Button>
			  <Button variant="outline-success">Heap Sort</Button>
			  <Button variant="outline-success">Bubble Sort</Button>
			</Navbar>)
	}

}
export default Navigation;
